\[
\frac{21}{2^2 \cdot 5^7} = \frac{21}{100 \cdot 5^5}
\]

接下来，我们计算 \(5^5\)：

\[
5^5 = 3125
\]

所以表达式变为：

\[
\frac{21}{100 \cdot 3125} = \frac{21}{312500}
\]

为了将这个分数转换为小数，我们执行除法 \(21 \div 312500\)。 However，我们可以通过注意到分母 \(312500\) 可以用2和5重写，使除法更容易。相反，我们可以将分数重写为：

\[
\frac{21}{2^2 \cdot 5^7} = \frac{21}{100 \cdot 5^5} = \frac{21}{100 \cdot 3125} = \frac{21}{4 \cdot 5^7 = 100 \cdot 5^5 = 312500|}
