Let's denote the three three-digit numbers as \(a\), \(b\), and \(c\). According to the problem, each of these numbers has exactly one digit changed to form a new number. Let's say the new numbers are \(a'\), \(b'\), and \(c'\) respectively. The condition given is that the sum of the new numbers \(a'\), \(b'\), and \(c'\) is equal to the sum of the original numbers \(a\), \(b\), and \(c\).

When we change exactly one digit in a three-digit number, the change in the value of the number can be calculated as follows:
- If we change the hundreds digit, the change in value is \(99 \times (\text{new digit} - \text{original digit})\).
- If we change the tens digit, the change in value is \(9 \times (\text{new digit} - \text{original digit})\).
- If we change the units digit, the change in value is \(1 \times (\text{new digit} - \text{original digit})\).

Since the sum of the new numbers is equal to the sum of the original numbers, the total change in value when forming \(a'\), \(b'\), and \(c'\) must be zero. This means that the sum of the changes in value for each number must be zero.

Let's consider the changes in value for each number:
- Let the change in \(a\) be \(99x_1\), \(9x_2\), or \(x_3\).
- Let the change in \(b\) be \(99x_4\), \(9x_5\), or \(x_6\).
- Let the change in \(c\) be \(99x_7\), \(9x_8\), or \(x_9\).

The sum of these changes must be zero:
\[99x_1 + 9x_2 + x_3 + 99x_4 + 9x_5 + x_6 + 99x_7 + 9x_8 + x_9 = 0.\]

This equation can be factored as:
\[99(x_1 + x_4 + x_7) + 9(x_2 + x_5 + x_8) + (x_3 + x_6 + x_9) = 0.\]

For this equation to hold true, \(x_1 + x_4 + x_7\), \(x_2 + x_5 + x_8\), and \(x_3 + x_6 + x_9\) must be such that their weighted sum equals zero. The only way this can happen is if each \(x_i\) is zero (since the coefficients 99, 9, and 1 are all positive and distinct). However, this would mean that no digits are changed, which is not possible since each number has exactly one digit changed.

