$f$ என வரையறுக்கப்பட்டிருப்பதாகக் கொள்ளுங்கள் \[f(x) = \left\{
\begin{array}{cl}
3-x & \text{ if } x \leq 3, \\
-x^3+2x^2+3x & \text{ if } x>3.
\end{array}
\right.\] $f^{-1}(0)+f^{-1}(6)$ ஐக் கணக்கிடுங்கள்.

